msItem.rubric:
X. sálmur Um vora friðþæging. Solvit mea debita Christus.
								Drottinn tók oss í sátt við sig, frá syndunum Jesús leysti mig; Tón;
								Mitt hjarta hvar til hryggist þú, etc

XII. sálmur. Um art og eiginlegleik sannrar trúar. Viva est et
								victrix; si modo vera fides. Lifandi og sönn trú sigurinn fær
								sanntrúaður er drottni kær. Tón, Ó faðir minn! ég þrællinn þinn, et;

XIV. sálm. Um Kristí dáðsamlega manndómstekningu. Fulgent
								cunabula Christi. Tón, Lít þú á fæðing lausnarans, ljómar af elsku
								vaggan hans. Tón, Ofan af himnum hér kom ég;

XV. sálmur. Um ávöxt Kristí manndóms. Sit grata redemtio
								Christi. Fögnum Jesúm sem fæddist oss frelsið þökkum með ástar koss;
								Tón; Til þín heilagi herra Guð; etc

XXIV. sálm. Um það, hvörninn Guð hefur fyrirætlað alla þá trúuðu
								til eilífrar sælu. In Christo electio facta. Í Jesú Guð oss útvaldi;
								til eilífs lífs í dýrðinni. Tón; Guð þann engil sinn Gabríel, etc
